import $ from 'jquery';

class Request {
    post(url, data) {
        $.ajax({
            url,
            type: 'POST',
            data,
            success: (msg) => {

            },
            complete: (res) => {
                try {
                    res = JSON.parse(res.responseText);
                    return res;
                }catch(e) {
                    return {
                        success: '',
                        error: 'Something went wrong'
                    }
                }
            }

        })
    }
}

export default new Request();
